import './App.css';
import { useState } from 'react'

function App () {

  const [events , setEvents]= useState ([
  
  {title : "TER (2022)" , id:3},
  {title : "TN (2022)" , id:4},
  {title : " THUNDER (2022)" , id:5},
  {title : "MAN (2022)" , id:6}
  ])

  const handLClick =(id) =>{
    
    setEvents(events.filter)([
        {title : "THOr : LOVE AND THUNDER (2022)" , id:1},
        {title : "THE GRAY MAN (2022)" , id:2},
        {title : "TER (2022)" , id:3},
        {title : "TN (2022)" , id:4},
        {title : " THUNDER (2022)" , id:5},
        {title : "MAN (2022)" , id:6}
    ])
  }


  return (
  <div className="App">

{
events.map ((event, index) =>(
    <div key={event.id}>
      <h2>{index + 1} - {event.title}</h2>
      <button onClick={() => handLClick (event.id)}>Delete</button>
    </div>

  ))
}
  </div>
);

}




export default App;
